import React, { Component } from "react";
import axios from "axios";

const DoctorProfile = async ({ match }) => {
  let doctor = {};
  const { data } = await axios.get("http://localhost:3900/api/doctors");
  doctor = data[0];
  console.log(doctor);
  return <p>{doctor.name}</p>;
};

export default DoctorProfile;
